import React from 'react';
import { View, StyleSheet } from 'react-native';

const Card = props => {
    return <View >{props.children}</View>
};

const styles = StyleSheet.create({
    card: {
        width: 300,
        height: 150,
        maxWidth: '80%',
        alignItems: 'center',
        shadowColor: 'black',
        shadowOffset: { width: 0, height: 2 },
        shadowRadius: 6,
        shadowOpacity: 0.26,
        elevation: 5,
        backgroundColor: 'white',
        padding: 20,
        borderRadius: 10
    }
});

export default Card
